/*Table structure for table `tb_student` */

DROP TABLE IF EXISTS `tb_student`;

CREATE TABLE `tb_student` (
  `id` int(30) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `password` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `gender` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `id_card` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `phone` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `work_unit` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `education` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `school` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `major` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `hire_date` datetime DEFAULT NULL,
  `examiner_number` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `first_time` datetime DEFAULT NULL,
  `exam_batch` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `project` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `ip` varchar(30) CHARACTER SET utf8 DEFAULT NULL,
  `state` tinyint(4) DEFAULT '0' COMMENT '是否在线',
  `exam_end_time` datetime DEFAULT NULL COMMENT '考试结束时间',
  `exam_start_time` datetime DEFAULT NULL COMMENT '考试开始时间',
  `scored` tinyint(4) DEFAULT '0' COMMENT '是否评分',
  `exam_state` varchar(20) CHARACTER SET utf8 DEFAULT '未开始考试' COMMENT '考试状态',
  `started` tinyint(4) DEFAULT '0' COMMENT '是否开始考试',
  `parameter_state` tinyint(4) DEFAULT '0' COMMENT '是否设置了参数',
  `total_score` varchar(10) DEFAULT NULL COMMENT '总分',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=617 DEFAULT CHARSET=utf32;

/*Data for the table `tb_student` */

